#### Important Equations

1. **Sum of the first \( n \) natural numbers:**
   \[
   \sum_{i=1}^{n} i = \frac{n(n + 1)}{2}
   \]

2. **Sum of the first \( n \) terms of an arithmetic series:**
   \[
   \sum_{i=1}^{n} (a + (i-1)d) = \frac{n}{2} [2a + (n-1)d]
   \]

3. **Factorial of a number \( n \):**
   \[
   n! = n \times (n-1) \times (n-2) \times \ldots \times 1
   \]

4. **Sum of factorials:**
   \[
   \sum_{i=1}^{n} i!
   \]

5. **Fibonacci sequence:**
   \[
   F(n) = F(n-1) + F(n-2) \text{ with } F(0) = 0 \text{ and } F(1) = 1
   \]

6. **Matrix symmetry condition:**
   \[
   M[i][j] = M[j][i] \text{ for all } i \neq j
   \]

